import React from 'react';
import ReactDOM from 'react-dom'
import './index.css';
let name = 'Nishi';
const img1 = "https://picsum.photos/200/199";
const img2 = "https://picsum.photos/200/200";
const img3 = "https://picsum.photos/200/201";
const links = "https://google.com";

const heading = {
    color: '#fa9191',
    textAlign: 'center',
    textTransform: 'capitalize',
    margin: '50px',
    textShadow: '0px 2px 4px rgb(221, 201, 201)'
}
ReactDOM.render(
    <>
    <h1 className = "Heading" style = "color: blue;"> My name is {name} </h1>

    <div className= "img_div">
    <img src = {img1} alt = "A Random Image"/>

    <a href={links} target = "_blank">
        <img src = {img2} alt = "A Random Image"/>
    </a>
    <img src = {img3} alt = "A Random Image"/>
    </div>
    </>,
    document.getElementById('root')
);

